fx_iconpicker.traverse = function(callback) {
    for (var i = 0; i < fx_iconpicker.icons.length; i++) {
        var set = fx_iconpicker.icons[i];
        for (var j = 0; j < set[1].length; j++) {
            callback(set[1][j], set);
        }
    }
};

fx_iconpicker.get_meta = function(val) {
    if (!val) {
        return null;
    }
    var v = val.split(' ');
    
    for (var i = 0; i < this.icons.length; i++) {
        var set = this.icons[i];
        if (set[0] !== v[0]) {
            continue;
        }
        for (var j = 0; j < set[1].length; j++) {
            var icon = set[1][j];
            if (icon[0] === v[1]) {
                return icon;
            }
        }
    }
    return null;
};

fx_iconpicker.set_class = function($node, value) {
    var class_parts = value.split(' '),
        c_class = $node.attr('class') || '',
        rex_parts = [];
    
    for (var i = 0; i < this.icons.length; i++) {
        var set = this.icons[i][0];
        rex_parts.push( set+'(\\s|-[^\\s]+|$)' );
    }
    
    var rex = new RegExp( rex_parts.join('|') , 'g');
    
    c_class = c_class.replace(rex, '');
    
    if (!class_parts[1]) {
        c_class += ' fa fa-ban';
    } else {
        c_class += ' ' + class_parts[0]+' '+class_parts[0]+'-'+class_parts[1];
    }
    $node.attr('class', c_class);
};

